import React from "react";
import { Route, Switch } from 'react-router-dom'
import Footer from "./components/Footer/Footer";
import Nav from "./components/Nav/Nav";
import Home from "./screens/Home";
import Pelispopu from "./components/Pelispopu/Pelispopu"
import Pelisencartel from "./components/Pelisencartel/Pelisencartel";
import PelisFav from "./components/"


function App() {
  return (
    <div>
      {/* lo dejo listo el sistema de ruteo */}
      <Nav />
      <Switch>
        <Route path="/" exact={true} component={Home} />
        <Route path="/favoritos" component={Home} />
        <Route path="populares" component={Pelispopu} />
        <Route path="cartelera" component={Pelisencartel} />
      </Switch>
      <Footer />
    </div>

  );
}

export default App;
